import { rest } from "./data";
import Affichere from "./Affichere";
export default function Q2(){
    return rest.filter(function(reste){
        return reste.typeplate==="marrocain"
    }).map(function(reste,i){
        return <Affichere rest={reste} key={i}/>
    })
}
